#include "chaplin.h"

double GstarGstarMeLO::matrix_element_squared(
                                        const double&s12,
                                        const double& s13,
                                        const double& s23)
{
    return 8.0*(
                s23/s13 - 2.0 * (s3+s4)/s13 - s3*s4/s13/s13
                +s13/s23 - 2.0 * (s3+s4)/s23 - s3*s4/s23/s23
                +2.0*pow(s3+s4,2.0)/ (s13*s23)
                );
}

complex<double> GstarGstarMeNLOSoft::polylog(int i,const double& z)
{
    return HPL2(0,1,z);
}

